await robot.userRequest('办公室巡逻');

await robot.goto('员工办公区');
await robot.speak('请员工们注意，下班后请尽快离开办公室，谢谢合作。');

await robot.goto('会议室');
await robot.goto('创作室');
await robot.goto('茶水间');

await robot.speak('巡逻结束，办公室已巡查完毕。');

